import React, { Component } from 'react';
import { Row, Col, Container, Navbar, Form, Image, Button, Nav } from 'react-bootstrap';

// import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';
// import imgLogoSezonaPocetna from './imgPretragaPocetna/sezona-logo.png';

import './FooterPocetna.css';

export default class FooterPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<div className="fixed-bottom">
					<Container fluid>
						<Row className="drzava-footer-pocetna">
							<Col>
								<h5 className="drzava-naslov-footer-pocetna">Bosna i Hercegovina</h5>
							</Col>
						</Row>
						<Row className="justify-content-between px-3 linkovi-footer-pocetna">
							<div>
								<span className="mr-4">aaa</span>
								<span className="mr-5">aaa</span>
								<span className="">aaa</span>
							</div>
							<div>
								<span>aaa</span>
								<span>aaa</span>
								<span>aaa</span>
							</div>
						</Row>
					</Container>
				</div>
			</React.Fragment>
		);
	}
}
